var quote = BindingSource.Current as IQuote;
var mappingService = Sage.Platform.Application.ApplicationContext.Current.Services.Get<Sage.Platform.SData.IAppIdMappingService>(true);
bool isIntegrationEnabled = mappingService.IsIntegrationEnabled();
if (isIntegrationEnabled)
{
    lueRequestedBy.SeedProperty = "ErpLogicalId";
    if (quote.Account != null) 
	{
		lueRequestedBy.SeedValue = quote.ErpLogicalId;
	}
}
else
{
    lueRequestedBy.SeedProperty = "Account.Id";
    if (quote.Account != null) lueRequestedBy.SeedValue = quote.Account.Id.ToString();
}

lueCurrencyCode.SeedProperty = "Period.Id";
string periodId = string.Empty;
Sage.SalesLogix.Period.Rules.GetPeriodIdForCurrentDate(out periodId);
lueCurrencyCode.SeedValue = periodId;
ctrlstCurrency.Visible = Sage.SalesLogix.BusinessRules.BusinessRuleHelper.IsMultiCurrencyEnabled();

var _entity = BindingSource.Current as IQuote;
_entity.Save();
var EqEnabled = Saleslogix.Integration.BOE.Common.Utilities.IsEqEnabled();
	if(EqEnabled && Sage.SalesLogix.BusinessRules.BusinessRuleHelper.IsCPQEnabled())
	{
		Sage.SalesLogix.Quote.Quote.CreateEqQuote(_entity.Id.ToString());
		ScriptManager.RegisterStartupScript(this, GetType(), "scriptDrillback",
	   @"require(['Sage/Utility'], function(Utility) {
		Sage.Utility.showDetailForm('Quote','"+_entity.Id.ToString()+@"');
		window.location.href = 'Quote.aspx?modeid=list';
		});", true);	
	}
	else
	{
		Response.Redirect("Quote.aspx?entityid="+_entity.Id.ToString()+"&modeid=detail");
	}
